s, 1938 -- Musical reactions, bold and otherwise -- Orchestras and audiences, Winter, 1938 -- Recent festivals in Rochester, 1938 -- Season'send, New York, spring, 1938 -- Coolidge Crusade, WPA, New York Season, 1938 -- Once again swing, Also "American Music" -- The case of Mr. Ives, Further notes on the winter season, 1938/9 -- O fair world of music, At the hall of music -- Season of Hindemith and Americans, 1939 -- The New York season opens, 1939 -- American music in the New York scene, 1940 -- Stravinsky and other moderns in 1940 -- The changing scene, New York, 1940 -- Films and theatre, 1943 [March-April] -- American Figure, with landscape [ Henry Franklin Belknap Gilbert]</subfield></datafield><datafield tag="505" ind1=" " ind2=" "><subfield code="a">(cont.) Theatre and films, 1943 [May-June] -- Theatre and films, 1943 [November] -- Ives today: is version and challenge -- Music as a liberal art -- Gabriel Faure -- New publications for music -- Scores for Graham: Festival at Columbia, 1946 -- Fallacy of the mechanistic approach [The Schillinger system] -- Walter Piston -- The composer's viewpoint [The League of Composers] -- An American destiny [Charles Edward Ives] -- The function of the composer, 1951 -- Wallingford Riegger -- The rhythmic basis of American music -- Current chronicle: New York, 1959 [Roger sessions: Violin concerto] -- Current chronicle: Italy [ISCM Festival, Rome, 1959] -- A further step/(1958) -- The composer's choices -- Sixty staves to read -- Shop talk by an American composer -- Current chronicle: Germany, 1960 [Nicolas Nabokov: Rasputin's end and Dmitri Shostakovitch: Lady MacBeth of Mzensk (Mtsensk)] -- The milieu of the American composer -- Letter from Europe -- Expressionism and American music -- The time dimension in music</subfield></datafield><datafield tag="505" ind1=" " ind2=" "><subfield code="a">(cont.) Current chronicle: New York [Edward Steuermann] --Introduction to a poetry reading session by W. H. Auden -- Charles Ives remembered -- Sonata for cello and piano, Sonata for flute, oboe, cello and harpsichord [Program notes] -- String quartet no.2 [Program notes] -- String quartets no.1 and no.2 [Program notes] -- "The composer is a university commodity" -- The orchestral composer's point of view -- Igor Stravinsky, 1882-1971 [Perspectives of new music] -- Igor Stravinsky, 1882-1971 [Eulogy] -- Variations for orchestra (1955) [program notes] -- Music criticism -- In memoriam: Stefan Wolpe, 1902-1972 -- String quartet no.3 [Program notes] -- Brass quintet -- Double concerto for harpsichord and piano with two chamber orchestras; Duo for violin and piano [program notes] -- Documents of a friendship with Ives -- Music and the time screen -- A symphony of three orchestras (1976).</subfield></datafield><datafield tag="650" ind1=" " ind2="0"><subfield code="a">Music</subfield><subfield code="y">20th century</subfield><subfield code="x">History and criticism.</subfield></datafield><datafield tag="700" ind1="1" ind2=" "><subfield code="a">Stone, Kurt</subfield></datafield><datafield tag="700" ind1="1" ind2=" "><subfield code="a">Stone, Else,</subfield><subfield code="d">1912-</subfield></datafield><datafield tag="901" ind1=" " ind2=" "><subfield code="a">46</subfield><subfield code="b">AUTOGEN</subfield><subfield code="c">46</subfield><subfield code="t">biblio</subfield></datafield></record>	IMPORT CONCERTO	\N	\N	\N	\N
