olfe and his sidekick, Archie, have just one clue to go on: a note from Amy's mother and a box with over </subfield><subfield code="2">50,000. Seems every month since Amy's birth, her mother received </subfield><subfield code="1">,000 from an unknown source and saved it for Amy's future. It's easily enough for Amy to afford Wolfe's services, and he grudgingly agrees. But as the weeks go by, Wolfe realizes this may be one of his most challenging cases ever. Someone doesn't want Amy's pedigree discovered, and that someone appears to wield great power. It isn't long before Wolfe and Archie come to believe that Amy's mother was murdered &#x2014; and that Amy could be next.</subfield></datafield><datafield tag="650" ind1=" " ind2="0"><subfield code="a">Wolfe, Nero (Fictitious character)</subfield><subfield code="x">Fiction.</subfield></datafield><datafield tag="650" ind1=" " ind2="0"><subfield code="a">Goodwin, Archie (Fictitious character)</subfield><subfield code="x">Fiction.</subfield></datafield><datafield tag="650" ind1=" " ind2="0"><subfield code="a">Private investigators</subfield><subfield code="z">New York (N.Y.)</subfield><subfield code="x">Fiction.</subfield></datafield><datafield tag="651" ind1=" " ind2="0"><subfield code="a">New York (NY.)</subfield><subfield code="v">Fiction.</subfield></datafield><datafield tag="655" ind1=" " ind2="7"><subfield code="a">Detective and mystery stories.</subfield><subfield code="2">gsafd</subfield></datafield><datafield tag="949" ind1=" " ind2=" "><subfield code="a">[MYS] BCAF</subfield></datafield><datafield tag="949" ind1=" " ind2=" "><subfield code="a">[MYS] HHAF</subfield></datafield><datafield tag="948" ind1=" " ind2=" "><subfield code="a">03/23/1994</subfield><subfield code="b">03/21/2000</subfield></datafield><datafield tag="596" ind1=" " ind2=" "><subfield code="a">3</subfield></datafield><datafield tag="901" ind1=" " ind2=" "><subfield code="a">211</subfield><subfield code="b">AUTOGEN</subfield><subfield code="c">211