213	1	1	\N	122	2020-10-27 10:26:51-04	2020-10-27 10:26:51-04	1	0	Title:winterofourdiscontent Author:steinbeck PartName: PartNumber:	AUTOGEN	213	<record    xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance"    xsi:schemaLocation="http://www.loc.gov/MARC21/slim http://www.loc.gov/standards/marcxml/schema/MARC21slim.xsd"    xmlns="http://www.loc.gov/MARC21/slim"><leader>00959cam a2200253Ia 4500</leader><controlfield tag="001">213</controlfield><controlfield tag="003">CONS</controlfield><controlfield tag="005">20130416184354.0</controlfield><controlfield tag="008">950227s1995    nyu           000 0 eng d</controlfield><datafield tag="035" ind1=" " ind2=" "><subfield code="a">(CONS)680</subfield></datafield><datafield tag="035" ind1=" " ind2=" "><subfield code="a">(SC LENDS)1121347</subfield></datafield><datafield tag="100" ind1="1" ind2=" "><subfield code="a">Steinbeck, John,</subfield><subfield code="d">1902-1968.</subfield></datafield><datafield tag="245" ind1="1" ind2="4"><subfield code="a">The winter of our discontent /</subfield><subfield code="c">John Steinbeck.</subfield></datafield><datafield tag="260" ind1=" " ind2=" "><subfield code="a">New York :</subfield><subfield code="b">Book-of-the-Month Club,</subfield><subfield code="c">1961.</subfield></datafield><datafield tag="300" ind1=" " ind2=" "><subfield code="a">311 p. ;</subfield><subfield code="c">22 cm.</subfield></datafield><datafield tag="520" ind1=" " ind2=" "><subfield code="a">In awarding John Steinbeck the 1962 Nobel Prize in Literature, the Nobel committee stated that with The Winter of Our Discontent, he had "resumed his position as an independent expounder of the truth, with an unbiased instinct for what is genuinely American.  Ethan Allen Hawley, the novel's protagonist, works as a clerk in a grocery store that his prominent family once owned. Without status in the town, his wife is restless, and his teenage children are hungry for the tantalizing material comforts he cannot provide. Then one day, in a moment of moral crisis, Ethan decides to take a holiday from his own scrupulous standards. In The Winter of Our Discontent, John Steinbeck, perhaps the master writer of the American working class, explores the cultural malaise of the 1960s and its far-ranging implications: social, familial, and personal.</subfield></datafield><datafield tag="651" ind1=" " ind2="0"><subfield code="a">New York (N.Y.)</subfield><subfield code="v">Fiction.</subfield><subfield code="0">(CONS)148</subfield></datafield><datafield tag="650" ind1=" " ind2="0"><subfield code="a">Ethics</subfield><subfield code="v">Fiction.</subfield></datafield><datafield tag="650" ind1=" " ind2="0"><subfield code="a">Conduct of life</subfield><subfield code="v">Fiction.</subfield></datafield><datafield tag="650" ind1=" " ind2="0"><subfield code="a">American Culture</subfield><subfield code="v">Fiction.</subfield></datafield><datafield tag="949" ind1=" " ind2=" "><subfield code="a">F Steinbeck, John</subfield><subfield code="w">ASIS</subfield><subfield code="h">BAFI</subfield><subfield code="p">$25.00</subfield><subfield code="i">24781726</subfield></datafield><datafield tag="994" ind1=" " ind2=" "><subfield code="a">X0</subfield><subfield code="b">SAL</subfield></datafield><datafield tag="596" ind1=" " ind2=" "><subfield code="a">2 4</subfield></datafield><datafield tag="901" ind1=" " ind2=" "><subfield code="a">213</subfield><subfield code="b">AUTOGEN</subfield><subfield code="c">213</subfield><subfield code="t">biblio</subfield></datafield></record>	1657101641.4870818927.0837807878	\N	\N	\N	\N
