um-soaked life of the island, Kemp becomes obsessed with the fiancee of Sanderson, a businessman involved in shady property development deals. When he is recruited by Sanderson to write favorably about his latest unsavory scheme, Kemp is presented with the choice to use his words for the corrupt  businessman's financial benefit, or use them to take him down.</subfield></datafield><datafield tag="650" ind1=" " ind2="0"><subfield code="a">Video recordings.</subfield></datafield><datafield tag="650" ind1=" " ind2="0"><subfield code="a">DVD-Video discs.</subfield></datafield><datafield tag="650" ind1=" " ind2="0"><subfield code="a">Journalists</subfield><subfield code="z">Puerto Rico</subfield><subfield code="v">Drama.</subfield></datafield><datafield tag="655" ind1=" " ind2="7"><subfield code="a">Comedy films.</subfield><subfield code="2">lcgft</subfield></datafield><datafield tag="700" ind1="1" ind2=" "><subfield code="a">Depp, Johnny.</subfield></datafield><datafield tag="700" ind1="1" ind2=" "><subfield code="a">Eckhart, Aaron.</subfield></datafield><datafield tag="700" ind1="1" ind2=" "><subfield code="a">Thompson, Hunter S.</subfield><subfield code="t">Rum Diary.</subfield></datafield><datafield tag="710" ind1="2" ind2=" "><subfield code="a">Sony Pictures Home Entertainment (Firm)</subfield></datafield><datafield tag="901" ind1=" " ind2=" "><subfield code="a">215</subfield><subfield code="b">AUTOGEN</subfield><subfield code="c">215</subfield><subfield code="t">biblio</subfield></datafield></record>	IMPORT FIC	\N	\N	\N	\N
