220	1	1	\N	131	2020-10-27 10:26:51.426709-04	2020-10-27 10:26:51.426709-04	1	0	Title:swordsmanofmars Author:kline PartName: PartNumber:	AUTOGEN	220	<record    xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance"    xsi:schemaLocation="http://www.loc.gov/MARC21/slim http://www.loc.gov/standards/marcxml/schema/MARC21slim.xsd"    xmlns="http://www.loc.gov/MARC21/slim"><leader>01300cam a2200421 a 4500</leader><controlfield tag="001">220</controlfield><controlfield tag="003">CONS</controlfield><controlfield tag="005">20130416181822.0</controlfield><controlfield tag="008">080115s2008    wau    e      000 f eng</controlfield><datafield tag="020" ind1=" " ind2=" "><subfield code="a">9781616648107 (hbk.)</subfield></datafield><datafield tag="020" ind1=" " ind2=" "><subfield code="a">1616648104 (hbk.)</subfield></datafield><datafield tag="035" ind1=" " ind2=" "><subfield code="a">(CONS)688</subfield></datafield><datafield tag="035" ind1=" " ind2=" "><subfield code="a">(SC LENDS)1527082</subfield></datafield><datafield tag="082" ind1="0" ind2="4"><subfield code="a">813/.52</subfield><subfield code="2">22</subfield></datafield><datafield tag="092" ind1="0" ind2=" "><subfield code="a">FIC KLI</subfield></datafield><datafield tag="099" ind1=" " ind2="9"><subfield code="a">SF Kline</subfield><subfield code="q">SCF</subfield></datafield><datafield tag="100" ind1="1" ind2=" "><subfield code="a">Kline, Otis Adelbert.</subfield></datafield><datafield tag="245" ind1="1" ind2="4"><subfield code="a">The swordsman of Mars /</subfield><subfield code="c">by Otis Adelbert Kline ; introduction by Michael Moorcock ; cover by Daren Bader.</subfield></datafield><datafield tag="260" ind1=" " ind2=" "><subfield code="a">Bellevue, Wash. :</subfield><subfield code="b">Paizo Publishing,</subfield><subfield code="c">2008.</subfield></datafield><datafield tag="300" ind1=" " ind2=" "><subfield code="a">229 p. ;</subfield><subfield code="c">22 cm.</subfield></datafield><datafield tag="490" ind1="0" ind2=" "><subfield code="a">Planet stories library ;</subfield><subfield code="v">bk. 12</subfield></datafield><datafield tag="500" ind1=" " ind2=" "><subfield code="a">PLANET STORIES is an imprint of Paizo Publishing, Bellevue, Washington.</subfield></datafield><datafield tag="520" ind1=" " ind2=" "><subfield code="a">In Swordsman of Mars, Harry Thorne, outcast scion of a wealthy East Coast family, seeks the greatest adventure of his life. He exchanges bodies with his look-alike, Martian Sheb Takkor, and is transported millions of years into the past to a Mars peopled with mighty warriors, beautiful women, and fearsome beasts. Sheb Takkor, a great swordsman in his own right, must fight his way across the deserts and jungles of ancient Mars to save the lovely Princess Thane and to defeat his arch-enemy Sel Han - or die trying! Edgar Rice Burroughs was the first great writer of planetary adventures. His one true rival and equal at writing planet stories was Otis Adelbert Kline. Kline was on the original editorial staff of Weird Tales, and was literary agent to Robert E. Howard of Conan fame.</subfield></datafield><datafield tag="520" ind1=" " ind2=" "><subfield code="a">Rebels on the red planet! Considered by many to be the only true equal of Edgar Rice Burroughs, Otis Adelbert Kline was a master of the sword and planet genre. From his position on the original editorial staff of Weird Tales and as the literary agent for Conan creator Robert E. Howard, Kline helped shape the face of science fiction as we know it. Now, in its first complete edition since 1933, Kline brings us the story of Harry Thorne, outcast scion of a wealthy East Coast family, who agrees to swap bodies with a Martian noble, thrusting him into a fierce and vibrant world of strange beasts and stranger people, where a man's future is determined by the strength of his sword arm. Tasked with tracking down and neutralizing another Earthman before he establishes a corrupt empire, and trapped between the love of two beautiful and dangerous women, will Harry Thorne wind up a slave in the dolorous baridium mines, or will he step forward and claim his destiny as a swordsman of Mars?</subfield></datafield><datafield tag="650" ind1=" " ind2="0"><subfield code="a">Life on other planets.</subfield></datafield><datafield tag="651" ind1=" " ind2="0"><subfield code="a">Mars (Planet)</subfield><subfield code="v">Fiction.</subfield></datafield><datafield tag="650" ind1=" " ind2="0"><subfield code="a">Science fiction.</subfield></datafield><datafield tag="700" ind1="1" ind2=" "><subfield code="a">Moorcock, Michael,</subfield><subfield code="e">introd.</subfield></datafield><datafield tag="700" ind1="1" ind2=" "><subfield code="a">Bader, Daren,</subfield><subfield code="e">ill.</subfield></datafield><datafield tag="901" ind1=" " ind2=" "><subfield code="a">220</subfield><subfield code="b">AUTOGEN</subfield><subfield code="c">220</subfield><subfield code="t">biblio</subfield></datafield></record>	IMPORT FIC	\N	\N	\N	\N
