227	1	1	\N	122	2020-10-27 10:26:51.426709-04	2020-10-27 10:26:51.426709-04	1	0	Title:runningman Author:bachman PartName: PartNumber:	AUTOGEN	227	<record    xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance"    xsi:schemaLocation="http://www.loc.gov/MARC21/slim http://www.loc.gov/standards/marcxml/schema/MARC21slim.xsd"    xmlns="http://www.loc.gov/MARC21/slim"><leader>00456cam a2200181 a 4500</leader><controlfield tag="001">227</controlfield><controlfield tag="003">CONS</controlfield><controlfield tag="005">20130416175204.0</controlfield><controlfield tag="008">000515s1982    nyua          000 1 eng d</controlfield><datafield tag="020" ind1=" " ind2=" "><subfield code="a">0451115082</subfield></datafield><datafield tag="035" ind1=" " ind2=" "><subfield code="a">(CONS)675</subfield></datafield><datafield tag="035" ind1=" " ind2=" "><subfield code="a">(SCLENDS)656898</subfield></datafield><datafield tag="092" ind1="0" ind2=" "><subfield code="a">FIC BAC</subfield></datafield><datafield tag="099" ind1=" " ind2="1"><subfield code="a">FIC/BAC</subfield></datafield><datafield tag="100" ind1="1" ind2=" "><subfield code="a">Bachman, Richard.</subfield></datafield><datafield tag="245" ind1="1" ind2="4"><subfield code="a">The running man /</subfield><subfield code="c">Richard Bachman.</subfield></datafield><datafield tag="260" ind1=" " ind2=" "><subfield code="a">New York :</subfield><subfield code="b">Signet Book,</subfield><subfield code="c">c1982.</subfield></datafield><datafield tag="300" ind1=" " ind2=" "><subfield code="a">219 p.</subfield></datafield><datafield tag="520" ind1=" " ind2=" "><subfield code="a">Stephen King (writing as Richard Bachman) crafted The Running Man early in his career, though after such mega-hits as Carrie and The Shining. A bit of a departure from the supernatural horror that is most frequently associated with his work, the novel describes a science fiction dystopia where market capitalism and television game shows have spiraled out of control, and the separation between the haves and the have-nots has been formalized with separate currencies. King establishes characters quickly, creating sympathy in the first few pages for Ben Richards--whose 18-month-old baby girl is suffering from a horrible cough, perhaps pneumonia. Not able to afford medicine, Richards enters himself in the last-chance money-making scheme of the Free-Vee games. The games include Treadmill to Bucks, in which heart-attack prone contestants struggle to outlast a progressively demanding treadmill, or the accurately named Swim the Crocodiles. After a rigorous battery of physical and mental examinations, Richards is assigned "Elevator Six"--the path of a chosen few--that leads to The Running Man game. In this game, the stakes and the prizes are raised. Success means a life of luxury. Failure means death. Unfortunately, few ever win the game; in fact, as the producer tells Richards, in six years no one has survived.</subfield></datafield><datafield tag="650" ind1=" " ind2="0"><subfield code="a">Horror tales, American.</subfield></datafield><datafield tag="655" ind1=" " ind2="0"><subfield code="a">Adventure stories.</subfield></datafield><datafield tag="655" ind1=" " ind2="0"><subfield code="a">Horror stories.</subfield></datafield><datafield tag="740" ind1="0" ind2=" "><subfield code="a">King, Stephen.</subfield></datafield><datafield tag="901" ind1=" " ind2=" "><subfield code="a">227</subfield><subfield code="b">AUTOGEN</subfield><subfield code="c">227</subfield><subfield code="t">biblio</subfield></datafield></record>	IMPORT FIC	\N	\N	\N	\N
