/subfield></datafield><datafield tag="521" ind1=" " ind2=" "><subfield code="a">MPAA rating: R (theatrical version); extended version, special features are unrated.</subfield></datafield><datafield tag="500" ind1=" " ind2=" "><subfield code="a">Special features: Includes Both theatrical and extended versions of the film; Commentary with Filmmakers and Cast; Deleted Scenes; Extended &amp; Alternate Scenes; The Making of Pineapple Express; The Action of Pineapple Express; Phone Booth; Line-O-Rama; Direct-O-Rama; Gag Reel; Item 9; Saul's Apartment; Raw Footage; Begley's Best; Red and Jessica's Guide to Marriage; Injury Report; Stuntmaster Ken; Rehearsal Footage; First Table Read; Comic-Con Panel; BD-Live.</subfield></datafield><datafield tag="500" ind1=" " ind2=" "><subfield code="a">LC copy is incomplete; computer disc is missing.</subfield><subfield code="5">DLC</subfield></datafield><datafield tag="500" ind1=" " ind2=" "><subfield code="a">Partially viewed.</subfield></datafield><datafield tag="500" ind1=" " ind2=" "><subfield code="a">Sources used: Internet movie database WWW site, viewed November 30, 2010; Sony Pictures WWW site, viewed November 30, 2010.</subfield></datafield><datafield tag="650" ind1=" " ind2="0"><subfield code="a">Slackers</subfield><subfield code="z">United States</subfield><subfield code="v">Drama.</subfield></datafield><datafield tag="650" ind1=" " ind2="0"><subfield code="a">Drug dealers</subfield><subfield code="z">United States</subfield><subfield code="v">Drama.</subfield></datafield><datafield tag="650" ind1=" " ind2="0"><subfield code="a">Marijuana</subfield><subfield code="z">United States</subfield><subfield code="v">Drama.</subfield></datafield><datafield tag="650" ind1=" " ind2="0"><subfield code="a">Drug traffic</subfield><subfield code="z">United States</subfield><subfield code="v">Drama.</subfield></datafield><datafield tag="650" ind1=" " ind2="0"><subfield code="a">Police corruption</subfield><subfield code="z">United States</s