de="a">Collective title from container.</subfield></datafield><datafield tag="500" ind1=" " ind2=" "><subfield code="a">Theatrical versions.</subfield></datafield><datafield tag="500" ind1=" " ind2=" "><subfield code="a">Adapted from the novel by J.R.R. Tolkien.</subfield></datafield><datafield tag="500" ind1=" " ind2=" "><subfield code="a">The hobbit: an unexpected journey originally released as a motion picture in &amp;#xfffd;2012.</subfield></datafield><datafield tag="500" ind1=" " ind2=" "><subfield code="a">The hobbit: the desolation of Smaug originally released as a motion picture in &amp;#xfffd;2013.</subfield></datafield><datafield tag="500" ind1=" " ind2=" "><subfield code="a">The hobbit : the battle of the five armies originally released as a motion picture in &amp;#xfffd;2014.</subfield></datafield><datafield tag="505" ind1="0" ind2=" "><subfield code="a">[Disc 1]. Hobbit: an unexpected journey -- [Disc 2]. Hobbit: an unexpected journey : special features -- [Disc 3]. Hobbit: the desolation of Smaug -- [Disc 4]. Hobbit: the desolation of Smaug: special features -- [Disc 5]. Hobbit: the battle of the five armies -- [Disc 6]. Hobbit : the battle of the five armies: special features</subfield></datafield><datafield tag="508" ind1=" " ind2=" "><subfield code="a">The hobbit: an unexpected journey: Director, Peter Jackson ; producers, Carolynne Cunningham, Zane Weiner, Fran Walsh, Peter Jackson ; screenwriters, Fran Walsh, Philippa Boyens, Peter Jackson, Guillermo Del Toro.</subfield></datafield><datafield tag="508" ind1=" " ind2=" "><subfield code="a">The hobbit : the desolation of Smaug: Director, Peter Jackson ; producers, Carolynne Cunningham, Zane Weiner, Fran Walsh, Peter Jackson ; screenwriters, Fran Walsh, Philippa Boyens, Peter Jackson, Guillermo Del Toro.</subfield></datafield><datafield tag="508" ind1=" " ind2=" "><subfield code="a">The hobbit : the battle of the five armies: Director, Peter Jackson ; producers, Carolynne Cunningham, Zane Weiner, Fran Walsh, Peter Jackson ; screenwriters, Fran Walsh, Philippa Boyens, Peter Jackson, Guillermo Del Toro.</subfield></datafield><datafield tag="511" ind1="1" ind2=" "><subfield code="a">The hobbit: an unexpected journey: Martin Freeman, Ian McKellan, Ken Stott, Richard Armitage, Lee Pace, Ian Holm, Hugo Weaving, Cate Blanchett, Elijah Wood, Christopher Lee, Andy Serkis, Sylvester McCoy.</subfield></datafield><datafield tag="511" ind1="1" ind2=" "><subfield code="a">The hobbit : the desolation of Smaug: Martin Freeman, Ian McKellan, Ken Stott, Richard Armitage, Lee Pace, Orlando Bloom, Evangeline Lilly, Cate Blanchett, Sylvester McCoy, Benedict Cumberbatch.</subfield></datafield><datafield tag="511" ind1="1" ind2=" "><subfield code="a">The hobbit : the battle of the five armies: Martin Freeman, Ian McKellan, Ken Stott, Richard Armitage, Lee Pace, Orlando Bloom, Evangeline Lilly, Cate Blanchett, Hugo Weaving, Christopher Lee, Ian Holm, Benedict Cumberbatch, Sylvester McCoy.</subfield></datafield><datafield tag="520" ind1=" " ind2=" "><subfield code="a">The hobbit: an unexpected journey: Follow Bilbo Baggins, who along with the Wizard Gandalf and 13 Dwarves, led by Thorin Oakenshield - is swept into an epic and treacherous quest to reclaim the lost Dwarf Kinfdom of Erebor. Runtime:2 hours, 49 minutes.</subfield></datafield><datafield tag="520" ind1=" " ind2=" "><subfield code="a">The hobbit : the desolation of Smaug: Out heros escape the giant Spiders and Wood-elves of Mirkwood before encountering the mysterious Bard, who smuggles them into Lake-town. Finally, reaching the Lonely Mountain, they confront the Dragon Smaug. Runtime:3 hours, 6 minutes.</subfield></datafield><datafield tag="520" ind1=" " ind2=" "><subfield code="a">The hobbit : the battle of the five armies: The Dwarves of Erebor have reclaimed their homeland, but face the consequences of unleashing Smaug. As five great armies go to war, Bilbo fights for his life, and the races of Dwarves, Elves, and Men must unite or be destroyed. Runtime:2 hours, 24 minutes.</subfield></datafield><datafield tag="521" ind1="8" ind2=" "><subfield code="a">MPAA rating: PG-13; for extended sequences of intense fantasy action violence, and frightening images.</subfield></datafield><datafield tag="538" ind1=" " ind2=" "><subfield code="a">DVD, Region 1, widescreen presentation; Dolby digital 5.1 surround.</subfield></datafield><datafield tag="546" ind1=" " ind2=" "><subfield code="a">In English with optional dubbed French or Spanish dialogue and optional English, French or Spanish subtitles; closed-captioned in English for the hearing impaired.</subfield></datafield><datafield tag="600" ind1="1" ind2="0"><subfield code="a">Baggins, Bilbo</subfield><subfield code="v">Drama.</subfield></datafield><datafield tag="650" ind1=" " ind2="0"><subfield code="a">Middle Earth (Imaginary place)</subfield><subfield code="v">Drama.</subfield></datafield><datafield tag="650" ind1=" " ind2="0"><subfield code="a">Hobbits (Fictitious characters)</subfield><subfield code="v">Drama.</subfield></datafield><datafield tag="650" ind1=" " ind2="0"><subfield code="a">Wizards</subfield><subfield code="v">Drama.</subfield></datafield><datafield tag="650" ind1=" " ind2="0"><subfield code="a">Elves</subfield><subfield code="v">Drama.</subfield></datafield><datafield tag="650" ind1=" " ind2="0"><subfield code="a">Dwarfs (Folklore)</subfield><subfield code="v">Drama.</subfield></datafield><datafield tag="650" ind1=" " ind2="0"><subfield code="a">Dragons</subfield><subfield code="v">Drama.</subfield></datafield><datafield tag="650" ind1=" " ind2="0"><subfield code="a">Imaginary wars and battles</subfield><subfield code="v">Drama.</subfield></datafield><datafield tag="655" ind1=" " ind2="7"><subfield code="a">Action and adventure films.</subfield><subfield code="2">lcgft</subfield><subfield code="0">(CONS)169</subfield></datafield><datafield tag="655" ind1=" " ind2="7"><subfield code="a">Drama.</subfield><subfield code="2">l