d others are as new and destructive as children. New York? She's got six. When a young man crosses the bridge into New York City, something changes. He doesn't remember who he is, where he's from, or even his own name. But he can feel the pulse of the city, can see its history, can access its magic. And he's not the only one. All across the boroughs, strange things are happening. Something is threatening to destroy the city and her six newborn avatars unless they can come together and stop it once and for all"--</subfield><subfield code="c">Provided by publisher.</subfield></datafield><datafield tag="650" ind1=" " ind2="0"><subfield code="a">Mythology</subfield><subfield code="v">Fiction.</subfield><subfield code="0">(CONS)131</subfield></datafield><datafield tag="650" ind1=" " ind2="0"><subfield code="a">Magic</subfield><subfield code="v">Fiction.</subfield><subfield code="0">(CONS)139</subfield></datafield><datafield tag="651" ind1=" " ind2="0"><subfield code="a">New York (N.Y.)</subfield><subfield code="v">Fiction.</subfield><subfield code="0">(CONS)148</subfield></datafield><datafield tag="655" ind1=" " ind2="7"><subfield code="a">Fantasy fiction.</subfield><subfield code="2">lcgft</subfield><subfield code="0">(CONS)126</subfield></datafield><datafield tag="800" ind1="1" ind2=" "><subfield code="a">Jemisin, N. K.</subfield><subfield code="t">Great cities trilogy ;</subfield><subfield code="v">1.</subfield><subfield code="0">(CONS)106</subfield></datafield><datafield tag="905" ind1=" " ind2=" "><subfield code="u">admin</subfield></datafield><datafield tag="901" ind1=" " ind2=" "><subfield code="a">265</subfield><subfield code="b">AUTOGEN</subfield><subfield code="c">265</subfield><subfield code="t">biblio</subfield><subfield code="s">oclc</subfield></datafield></record>	1657101625.9683652307.2568007763	\N	\N	\N	\N
