 Brett Varvel, Kevin Downes, Morgana Shaw.</subfield></datafield><datafield tag="508" ind1=" " ind2=" "><subfield code="a">Director, Andrew Erwin, Jon Erwin.</subfield></datafield><datafield tag="538" ind1=" " ind2=" "><subfield code="a">DVD.</subfield></datafield><datafield tag="546" ind1=" " ind2=" "><subfield code="a">English, French, Spanish audio; French, Spanish subtitles.</subfield></datafield><datafield tag="546" ind1=" " ind2=" "><subfield code="a">English subtitles for the deaf and hard of hearing.</subfield></datafield><datafield tag="521" ind1="8" ind2=" "><subfield code="a">MPAA rating: PG.</subfield></datafield><datafield tag="520" ind1=" " ind2=" "><subfield code="a">Tells the inspirational true story of Kurt Warner, who went from a stockboy at a grocery store to a two-time NFL MVP, Super Bowl champion, and Hall of Fame quarterback. The film centers on Warner's unique story and years of challenges and setbacks that could have derailed his aspirations to become an NFL player, but just when his dreams seemed all but out of reach, it is only with the support of his wife, Brenda and the encouragement of his family, coaches, and teammates that Warner perseveres and finds the strength to show the world the champion that he already is.</subfield></datafield><datafield tag="650" ind1=" " ind2="4"><subfield code="a">Drama.</subfield></datafield><datafield tag="655" ind1=" " ind2="4"><subfield code="a">Biographical.</subfield></datafield><datafield tag="700" ind1="1" ind2=" "><subfield code="a">Levi, Zachary</subfield></datafield><datafield tag="700" ind1="1" ind2=" "><subfield code="a">Paquin, Anna</subfield></datafield><datafield tag="700" ind1="1" ind2=" "><subfield code="a">Quaid, Dennis</subfield></datafield><datafield tag="700" ind1="1" ind2=" "><subfield code="a">Baldwin, Adam</subfield></datafield><datafield tag="700" ind1="1" ind2=" "><subfield code="a">Mcgill, Bruce</subfield></datafield><datafield tag="700" ind1="1" ind2=" "><subfield code="a">Blain,