312	1	1	1	125	2022-06-17 11:28:55.90985-04	2022-06-17 11:28:55.90985-04	1	0	Title:kenburnsmuhammadali Author:pbs PartName: PartNumber:	AUTOGEN	312	<record    xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance"    xsi:schemaLocation="http://www.loc.gov/MARC21/slim http://www.loc.gov/standards/marcxml/schema/MARC21slim.xsd"    xmlns="http://www.loc.gov/MARC21/slim"><leader>02194ngm a22003492a 4500</leader><controlfield tag="001">312</controlfield><controlfield tag="003">CONS</controlfield><controlfield tag="005">20220207080232.1</controlfield><controlfield tag="007">vd cvaizs</controlfield><controlfield tag="008">220207s2021    xxu450 e          vleng d</controlfield><datafield tag="035" ind1=" " ind2=" "><subfield code="a">(MWT)MWT14111704</subfield></datafield><datafield tag="040" ind1=" " ind2=" "><subfield code="a">Midwest</subfield></datafield><datafield tag="020" ind1=" " ind2=" "><subfield code="a">9781531713959 :</subfield><subfield code="c">$69.99</subfield></datafield><datafield tag="024" ind1="1" ind2=" "><subfield code="a">841887045704</subfield></datafield><datafield tag="028" ind1="4" ind2="2"><subfield code="a">14111704</subfield></datafield><datafield tag="245" ind1="0" ind2="0"><subfield code="a">Ken Burns: Muhammad Ali</subfield><subfield code="h">[videorecording].</subfield></datafield><datafield tag="250" ind1=" " ind2=" "><subfield code="a">Widescreen ed.</subfield></datafield><datafield tag="260" ind1=" " ind2=" "><subfield code="a">[United States] :</subfield><subfield code="b">Pbs,</subfield><subfield code="c">2021.</subfield></datafield><datafield tag="300" ind1=" " ind2=" "><subfield code="a">4 videodiscs (ca. 450 min.) :</subfield><subfield code="b">sd., col. ;</subfield><subfield code="c">4 3/4 in.</subfield></datafield><datafield tag="500" ind1=" " ind2=" "><subfield code="a">11/09/2021</subfield></datafield><datafield tag="511" ind1="1" ind2=" "><subfield code="a">Muhammad Ali, Keith David.</subfield></datafield><datafield tag="508" ind1=" " ind2=" "><subfield code="a">Director, Ken Burns, Sarah Burns, David Mcmahon.</subfield></datafield><datafield tag="538" ind1=" " ind2=" "><subfield code="a">DVD.</subfield></datafield><datafield tag="546" ind1=" " ind2=" "><subfield code="a">English, Spanish audio.</subfield></datafield><datafield tag="546" ind1=" " ind2=" "><subfield code="a">English subtitles for the deaf and hard of hearing.</subfield></datafield><datafield tag="520" ind1=" " ind2=" "><subfield code="a">He was one of the best-known men of the 20th century, a three-time heavyweight boxing champion who captivated millions of fans throughout the world with his mesmerizing combination of speed, grace, and power in the ring, and charm and playful boasting outside of it. At the height of his fame, he took American life, the racial prejudices, the religious biases, the role of celebrities, the role of sports in society, and refashioned it in his image. His brazen outspokenness and unsurpassed boxing skills made him a heroic symbol of black masculinity to African Americans across the country, yet at times he seemed to take pride in humiliating his black opponents. In an age of sit-ins and freedom rides aimed at ending segregation, his deep ties to the Nation of Islam, a black nationalist organization that preached separation, made him, for a time, among the most feared and reviled men in the country. At the peak of his ability, he bravely sacrificed his career by refusing to go to war in Vietnam, and though he was condemned for it, Muhammad Ali would later be celebrated as a principled pacifist.  Includes Spanish SDH subtitles.</subfield></datafield><datafield tag="650" ind1=" " ind2="4"><subfield code="a">African-American Heritage.</subfield></datafield><datafield tag="650" ind1=" " ind2="4"><subfield code="a">Documentary.</subfield></datafield><datafield tag="655" ind1=" " ind2="4"><subfield code="a">Documentary.</subfield></datafield><datafield tag="700" ind1="1" ind2=" "><subfield code="a">Ali, Muhammad</subfield></datafield><datafield tag="700" ind1="1" ind2=" "><subfield code="a">David, Keith</subfield></datafield><datafield tag="856" ind1="7" ind2=" "><subfield code="3">View cover art</subfield><subfield code="u">https://thumbnail.midwesttape.com/14111704_180.jpg</subfield><subfield code="2">https</subfield></datafield><datafield tag="962" ind1=" " ind2=" "><subfield code="b">BR1</subfield><subfield code="p">48.99</subfield><subfield code="q">1</subfield></datafield><datafield tag="905" ind1=" " ind2=" "><subfield code="u">admin</subfield></datafield><datafield tag="901" ind1=" " ind2=" "><subfield code="a">312</subfield><subfield code="b">AUTOGEN</subfield><subfield code="c">312</subfield><subfield code="t">biblio</subfield><subfield code="s">oclc</subfield></datafield></record>	1655479735.869892285.43633185939	\N	\N	\N	\N
